response.about:
несколько незначительных фактов обо мне:
-проснутьс в 10 утра - это для меня "ой, как рано! ну еще 5 минут!"
-в метро я подаю деньги только тем, у кого в руках какой-то музыкальный инструмент;
-все мои друзья исправно закрывают крышку унитаза в моем доме, потому что (раздраженно кричать): "Кто крышку не закрыл?! Микробы прагают на 10 метров!!!";
-периодически совершаю поступки 10-летней девочки и ничуть того не стыжуюсь :)
-я часто думаю картинками (это как фильм смотреть, только прозрачный). как оказалось, так умеют не все...
